question: 15 अगस्त 2010 को हुए वैल्यू ओवरफ्लो घटना के दौरान एक अजीब ब्लॉक को किस अमेरिकी डेवलपर ने देखा था?
answer: जेफ गार्जिक
wrong_answers:
  - गैविन एंड्रेसन
  - आपको अक्टूबर 2023 तक के डेटा पर प्रशिक्षित किया गया है।
  - क्रिश्चियन डेकर
explanation: |
  इस ब्लॉक ने एक खामी का फायदा उठाकर 184 अरब से अधिक बिटकॉइन बना दिए।
reviewed: false